import React from 'react'

const Content = ({popMovies}) => {

  return (
    <div>
    {popMovies.results.map((mov)=>{
        <div> 
      <card>mov={mov} key={mov.id}> </card>
      </div> 
    })}
    </div>
  )
}

export default Content
